    >>> remove_duplicates([1, 2, 3, 2, 4])
    [1, 3, 4]
    """
    if numbers is None:
        return []
    left = numbers[:]
    right = numbers[::-1]
    if len(left) == len(right):
        return left
    for i in range(len(left)):
        if left[i] < right[i]:
            left.remove(left[i])
            left.remove(right[i])
    if len(left) == len(right):
        return left
    for i in range(len(left)):
        if left[i] > right[i]:
            left.remove(left[i])
            left.remove(right[i])
    if len(left) == len(right):
        return left
    for i in range(len(left)):
        if left[i] < right[i]:
            left.remove(left[i])
            left.remove(right[i])
    if len(left) == len(right):
        return left
    for i in range(len(left)):
        if left[i] > right[i]:
            left.remove(left[i])
            left.remove(right[i])
    return right

